import React from 'react';

class FeedForm extends React.Component {
    constructor(props) {
        super(props);
        this.state = { numberOfPeople: '', billAmount: '' };
        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        this.setState({ numberOfPeople: event.target.numberOfPeople, billAmount: event.target.billAmount });
    }

    handleSubmit(event) {
        alert('A name was submitted: ' + this.state.value);
        event.preventDefault();
        let request = {
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json'
            },
            // body: JSON.stringify({ numberOfPeople: event.target.numberOfPeople, billAmount: event.target.billAmount })
        };
        fetch(this.props.action, request);
    }

    render() {
        return (
            <form onSubmit={this.handleSubmit}>
                <label>
                    Number of people:
                    <input type="number" value={this.state.value} onChange={this.handleChange} />
                </label>
                <br />
                <label>
                    Bill amount:
                    <input type="number" value={this.state.value} onChange={this.handleChange} />
                </label>
                <br />
                <input type="submit" value="Submit" />
            </form>
        );
    }
}
export default FeedForm;
